import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

export default function Gameover(props) {
    return (
        <View style={styles.gameoverContainer}>
            <Text>Game Over!</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    gameoverContainer:{
        boxSizing: 'border-box'
    }
});
